import APIHandler from "./APIHandler.js";

class APICity extends APIHandler {
  async queryCitiesByIdCountry(_idCountry, _idAvoidCity) {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/city/findby/country?idcountry=" +
          _idCountry+"&avoidcity="+_idAvoidCity
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }
}

export default APICity;
